using AssemblyLib.Utils;using System;using System.Collections.Generic;using System.Collections.ObjectModel;using System.Linq;using System.Text;using System.Threading.Tasks;namespace AssemblyLib.AssemblyModels{	public class ShellOutputModel : Notifier	{		public ShellOutputModel()		{					No = "";			PlateWidth = "";			Material = "";			ImpactTest = "";			Thickness = "";		}				private string _No;		public string No			{				get { return _No; }				set				{					_No = value;					OnPropertyChanged(nameof(No));				}			}				private string _PlateWidth;		public string PlateWidth			{				get { return _PlateWidth; }				set				{					_PlateWidth = value;					OnPropertyChanged(nameof(PlateWidth));				}			}				private string _Material;		public string Material			{				get { return _Material; }				set				{					_Material = value;					OnPropertyChanged(nameof(Material));				}			}				private string _ImpactTest;		public string ImpactTest			{				get { return _ImpactTest; }				set				{					_ImpactTest = value;					OnPropertyChanged(nameof(ImpactTest));				}			}				private string _Thickness;		public string Thickness			{				get { return _Thickness; }				set				{					_Thickness = value;					OnPropertyChanged(nameof(Thickness));				}			}			}}